// platformer.
// 
// will have a time-limit.
// 
// 5 levels:
// 
// first level introduces moon spirit
// 
// second level introduces sun spirit & their attack move
// 
// third level will have them both
// 
// fourth will be both
// 
// fifth will be mini boss fight = game win
controller.up.onEvent(ControllerButtonEvent.Pressed, function () {
    if (characterAnimations.matchesRule(myMainPlayer, characterAnimations.rule(Predicate.HittingWallDown))) {
        myMainPlayer.vy = -120
        canDoubleJump = characterAnimations.matchesRule(myMainPlayer, characterAnimations.rule(Predicate.HittingWallDown))
    }
})
scene.onOverlapTile(SpriteKind.Player3, sprites.swamp.swampTile0, function (sprite, location) {
    game.gameOver(false)
})
controller.B.onEvent(ControllerButtonEvent.Pressed, function () {
    if (facingLeft) {
        myMainCharacterProjectile = sprites.createProjectileFromSprite(assets.image`sunProjectile`, myMainPlayer, -100, 0)
    } else {
        myMainCharacterProjectile = sprites.createProjectileFromSprite(assets.image`sunProjectile`, myMainPlayer, 100, 0)
    }
})
scene.onOverlapTile(SpriteKind.Player3, sprites.dungeon.hazardLava0, function (sprite, location) {
    game.gameOver(false)
})
